    name: 'LeftSideBar',
    components: {

    },
    data() {
        return {
            miniVariant: false,
            clipped: false,
            scrollSettings: {
                maxScrollbarLength: 160
            },
            menus: [] as any,
            tongSoKhachDatPhong: 0 as any,
            tongSoKhachDatDichVu: 0 as any,
            lstNhomMxh: [] as any,
            boPhanID: store.state.user.Profile.NhanVien.BoPhanID
        }
