    created() {
        this.getMenu();
        this.$eventBus.$on('getSoKhachDatPhong', this.getSoKhachDatPhong);
        this.$eventBus.$on('getSoKhachDatDichVu', this.getSoKhachDatDichVu);
    },
    computed: {
        showLeftSideBar(): boolean {
            return store.state.app.showLeftSideBar
        },
